import {
  IonBackButton,
  IonButtons,
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
} from "@ionic/react";
import React, { useState } from "react";
import { useParams } from "react-router";
import MultiForm from "../../components/MultiForm/MultiForm";
import InputControls from "../../components/InputControls/InputControls";

interface Agent {
  complexName: string;
  contractId: string;
  name: string;
  surname: string;
  id: string;
  cellNum: string;
  street1: string;
  street2: string;
  city: string;
  province: string;
  postalCode: string;
  password: string;
}


const CardDetails: React.FC = () => {
  const [selectedSegment, setSelectedSegment] = useState<"Update" | "Delete">(
    "Update"
  );
  const [isDisabled, setIsDisabled] = useState<true | false>(false);

  const { name, type, back } =
    useParams<{
      name: string;
      type: "agent" | "complex" | "package" | "promotion";
      back: string;
    }>();

  const selectedSegmentHandler = (selectedValue: "Update" | "Delete") => {
    setSelectedSegment(selectedValue);
    if (selectedValue == "Delete") {
      setIsDisabled(true);
    } else {
      setIsDisabled(false);
    }
  };

  let result;

  const url = "/page/";

  if (type === "agent") {
    /* Gotten from the API*/
    const agent: Agent = {
      complexName: "",
      contractId: "",
      name: "",
      surname: "",
      id: "",
      cellNum: "",
      street1: "",
      street2: "",
      city: "",
      province: "",
      postalCode: "",
      password: "",
    };

    result = agent;
  }

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton
              defaultHref={url.concat(back).concat("/").concat(type)}
            />
          </IonButtons>
          <IonTitle>{name}</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <InputControls
          selectedValue={selectedSegment}
          onSelectedValue={selectedSegmentHandler}
        />
        <MultiForm
          buttonName={selectedSegment}
          type={type}
          isDisabled={isDisabled}
          content={result}
        />
      </IonContent>
    </IonPage>
  );
};

export default CardDetails;
